import * as vscode from 'vscode';
import * as path from 'path';

export class DepNodeProvider implements vscode.TreeDataProvider<Dependency> {

	private _onDidChangeTreeData: vscode.EventEmitter<Dependency | undefined | void> = new vscode.EventEmitter<Dependency | undefined | void>();
	readonly onDidChangeTreeData: vscode.Event<Dependency | undefined | void> = this._onDidChangeTreeData.event;

	constructor() {
	}

	refresh(): void {
		this._onDidChangeTreeData.fire();
	}

	getTreeItem(element: Dependency): vscode.TreeItem {
		return element;
	}

	readItemFromEdgelist(item: string): Thenable<Dependency[]>{
		let returnResult: Dependency[] = [];
		const arr = edgelist.split('\t');
		for(let line of arr) {
			let splittedLine = line.split(' ');
			if (splittedLine[0] === item){
				if (line.includes("constructor"))
					returnResult.push(new Dependency(splittedLine[1], "constructor", vscode.TreeItemCollapsibleState.Collapsed));
				else if (line.includes("child"))
					returnResult.push(new Dependency(splittedLine[1], "child", vscode.TreeItemCollapsibleState.Collapsed));
			}
		}
		return Promise.resolve(returnResult);
	}

	getChildren(element?: Dependency): Thenable<Dependency[]> {
		if (element){
			return this.readItemFromEdgelist(element.label);
		}else{
			return Promise.resolve([
						new Dependency("GENERIC_LISTS", "child", vscode.TreeItemCollapsibleState.Collapsed),
						new Dependency("FILE_ELEMENT", "child", vscode.TreeItemCollapsibleState.Collapsed),
					]);
		}
	}
}

export class Dependency extends vscode.TreeItem {

	constructor(
		public readonly label: string,
		private readonly type: string,
		public readonly collapsibleState: vscode.TreeItemCollapsibleState
	) {
		super(label, collapsibleState);

		this.tooltip = `${this.label}`;
		this.description = this.type;
		if (this.type === "constructor")
			this.iconPath = {
				light: path.join(__filename, '..', '..', 'resources', 'light', 'dependency.svg'),
				dark: path.join(__filename, '..', '..', 'resources', 'dark', 'dependency.svg')
			};
		else if (this.type === "child")
			this.iconPath = {
				light: path.join(__filename, '..', '..', 'resources', 'light', 'document.svg'),
				dark: path.join(__filename, '..', '..', 'resources', 'dark', 'document.svg')
			};
	}

	contextValue = 'dependency';
}

